INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5920, 4745, 'Imatinib', 'Coadministration of imatinib with strong CYP450 3A4 inhibitors such as grapefruit juice, may significantly increase the plasma concentrations of imatinib, a known substrate of CYP450 3A4.  The proposed mechanism is inhibition of CYP450 3A4-mediated metabolism of imatinib by certain compounds present in grapefruits.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
