INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5928, 6404, 'Imipramine', 'Concomitant use of ethanol and a tricyclic antidepressant (TCA) may result altered TCA plasma levels and efficacy, and additive impairment of motor skills, especially driving skills.  Acute ethanol ingestion may inhibit TCA metabolism, while chronic ingestion of large amounts of ethanol may induce hepatic TCA metabolism.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c4d8ec115c2300c4357d104dda10f06e0c00226761bf39a189ca4d0ed49e0c259d2ffba5055c9b5a0446b1be32620deb508a31a683765d0162cda066eae79c5f534a346717a1c1330ff420d05af6888b40b5a66f1d5b280a5da5b170d5d63f94f922c6b35ef9ac5bcd7820b0de980cb320661d0cf56681d97eeadd4f43d9ae818009767d3be9f3e164f46e7', NULL, X'');
